      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 11,
      "text": "1. Gulden zu Florins, a 60 kr. zu verkauffen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 26,
      "text": "22. Ein Englisches Cartefin soll nun / sambt anderer von Porcellan und Cristal."
    },
    {
      "date": "1731-01-02", 
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 7,
      "text": "23. Schöne Blumen und Aurikeln."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offerirt:", 
      "ntokens": 13,
      "text": "1. Emanuel Martin / ein berühmter Advocat: erbietet sich täglich 6. der Commun zu umfahen von früh / nachmittags für 30 kr."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "ntokens": 11,
      "text": "Ein Capital von 100. Pfunden auff anständige Obligation zu verinteressiren."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu entlehnen begehrt:",
      "ntokens": 32,
      "text": "1. Ein Bett von 400. biß 500. Gulden / jedoch auff sichere Unterpfand / und wo möglich ist / ein baar vor considerable Unterpfänder / auch wo möglich ist / ein baar vor considerable Unterpfänder / auch wo möglich gegen rechtschaffne Personen. Melden sich"
    },
    {
      "date": "1731-01-02",
      "tags_section": "Gestimen- und verlohrne Sachen:",
      "ntokens": 41,
      "text": "1. Am Freytage den 26. hujus, ist einem ardern ein Vitriol-Stock das dritte Gesperr braun Leder / in einem Gässel/ nicht weit von Heil. Creutz-Closter entfallen. Wer solchen gefunden / beliebe es beym Buchbinder dasigen Gegend zu bringen / allwo ihm ein proportionirliches Recompens erstattet wird."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Zu vermiethen.",
      "ntokens": 32,
      "text": "1. In dem sogenannten Zeit vermiethen lassen Schind-hof seynd 2. ansehnliche a parte Zimmer / so ehedeffen offerirt Directorn mit Geist englischbaarer ware den 1. Januar mit dem Hauß zu vexiren."
    }
  ]
}
